import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from '../Navbar/Navbar';
import Home from '../Home/Home';
import Faq from '../Faq/Faq';
import OurTeam from '../OurTeam/OurTeam';
import OTPVerification from '../OTPVerification/OTPVerification';
import MoneyTransfer from '../MoneyTransfer/MoneyTransfer'; // Adjusted import path
import QRScanner from '../QRScanner/QRScanner'; // Import the QRScanner component
import Footer from '../Footer/Footer';
import './Hero.css';

const Hero = () => {
  return (
    <Router>
      <div className="Hero">
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/faq" element={<Faq />} />
          <Route path="/our-team" element={<OurTeam />} />
          <Route path="/verify-otp" element={<OTPVerification />} />
          <Route path="/money-transfer" element={<MoneyTransfer />} />
          <Route path="/qr-scanner" element={<QRScanner />} /> {/* Add the QRScanner route */}
        </Routes>
        <Footer />
      </div>
    </Router>
  );
};

export default Hero;
